import styled from 'styled-components';

export const Container = styled.div`
  input {
    flex: 1;
    background: #232129;
    border: 0;
    border-radius: 10px;
    padding: 16px;
    width: 100%;
    border: 2px solid #232129;
    color: #666360;
    display: flex;
    align-items: center;
    &::placeholder {
      color: #666360;
    }
    & + input {
      margin-top: 8px;
    }
  }
`;
